export const Register = (email, password) => {

    const datas = {
        user: {
            email,
            password
        }
    }

    fetch("https://mycoffees.herokuapp.com/users", {
        method: "post",
        headers: {
            "Content-Type": "application/json",
        },
        body: JSON.stringify(datas),
    }).then((response) => {
        return (response.json())
    }).then((response) => {
        console.log(response)
    })
}
